import React from 'react'
import logo from '../assets/images/sankalptaru-new-logo-white.png'
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import PersonIcon from '@mui/icons-material/Person';

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  // ...theme.typography.body2,
  // padding: theme.spacing(1),
  // textAlign: 'center',
  // color: 'black',
  // fontFamily: 'Barlow Condensed'
}));

const Header = () => {
  return (
    <div className='headercontainer'>
            <Box style={{display:"flex", alignItems:"center", justifyContent:"space-between"}}>
                <Box >
                <img src={logo} id='logo' style={{height:"77px"}}></img>
                </Box>
                <Box style={{display:"flex", alignItems:"center"}}>
                <Box className='boxheader'>
                    <Item className='headertags'>ABOUT US</Item>
                </Box>
                <Box>
                    <Item className='headertags'>GALLERY</Item>
                </Box>
                <Box>
                    <Item className='headertags'>BLOGS</Item>
                </Box>
                <Box>
                    <Item className='headertags'>CONTACT</Item>
                </Box>
                <Box>
                    <Item className='headertags'>PLANT A TREE</Item>
                </Box>
                </Box>


                <Box>
                  <Box style={{display:"flex", alignItems:"center",justifyContent:"end"}}>
                    <PersonIcon style={{color: "white"}}/>
                    <p style={{color: "white"}}>LOGIN</p>
                  </Box>

                </Box>
            </Box>
    </div>
  )
}

export default Header
